import Header from "./Header";
import {MantineProvider} from '@mantine/core'
const Layout = ({children}) => {
  return (
    <MantineProvider theme={{}}>
    <div>
      <Header />
      <div>{children}</div>
    </div></MantineProvider>
  );
};

export default Layout;
